@mixin colorItem($color: $white) {
  width: 50px;
  height: 50px;
  background-color: $color;
  border-radius: 50%;
  margin-top: 10px;
  margin-right: 10px;
}
@mixin firstLetter() {
  &::first-letter {
    color: $red2;
  }
}
@mixin h1($color: $grey1) {
  color: $color;
  display: inline-block;
  font-size: 6rem;
  font-family: $titleFont;
  line-height: 0.47;
  @include firstLetter();
  @media ($tablet) {
