  }
}
@mixin logo($color: $grey1) {
  @include h1();
  text-shadow: 0px 1px 1px rgba(0, 0, 0, 0.05);
  text-transform: uppercase;
}
@mixin h2($color: $grey1) {
  @include h1();
  font-size: 4.8rem;
  @media ($tablet) {
