}
@mixin h3($color: $grey1) {
  color: $color;
  font-size: 3.6rem;
  font-family: $titleFont;
  text-shadow: 0px 1px 0 rgba(0, 0, 0, 0.35);
  line-height: normal;
  font-weight: normal;
  @media ($tablet) {
    font-size: 1.8rem;
  }
}
@mixin p1($color: $dark2) {
